INSERT INTO `events_mainevent` VALUES (7,'The Potter Quiz','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(8,'TURNCOAT','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"background-color:white\"><span style=\"color:black\">Turncoat is a rhetoric event where the speakers contradict themselves. The speaker starts by taking a stance on the topic and switches sides after a specific duration of time. </span></span></span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">&nbsp;</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Yash Goswami  8505028076',7),(13,'RapWars','<p>The following details are for each face-off between rappers. There are 6 people coming in. So we shall be having two rounds. Three people go through Round One. The second round is a three-way face off which will decide the winner</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sashank 6375352568',2),(15,'OTAKU(ANIME QUIZ)','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(19,'Wordstock','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Think you can play with the English language? This event is sure to make you eat your words with a handful of crosswords, rebuses and Tom Swifties taking you to your wits&#39; end. Crack &#39;em and be crowned the king of words.&nbsp;</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aditya Vasudevan – 78750 35855',12),(20,'Word Wars','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:black\">Words were never so much fun. In this crazy maze of words, letters, phrases and sentences, hone your skills and revamp your enthusiasm of discovering simple things. </span></p>\r\n\r\n<p>It is a fun event comprising of different forms of word games, from riddles to spellathons and simple spell checks.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nimisha Jain  9414177993, 9610478244',12),(21,'Speed Scrabble','<p><span style=\"color:#f4