g Pathak- +91-9131984337',3),(75,'Street Dance','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">As the name suggests, Street Dance is a street-style dance event organized by the Department of Theatre. It features performances by teams from colleges around the country. Street Dance is considered a crowd favorite and is held in the Rotunda, the open-air amphitheater of BITS. After the initial elimination round, about eight to ten teams are shortlisted for the final round. The first stage of the final round features street-style performances by the participating teams. The second stage of the final round is a face-off challenge between pairs of teams. Teams are judged on the basis of their choreography, synchronization, footwork, and power moves, along with costume, innovation and overall impact.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',3),(76,'Razzmatazz','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Razzmatazz is a one-of-its-kind group dance competition that tests finesse and artistry in showcasing coordinated group choreography. With equal weightage in judgement given to execution, presentation and creativity, it is fashioned to test the esprit de corps of the participating teams. All forms of dance including fusions are allowed. So trip the light fantastic toe and let there be a razzle-dazzle of sheer splendor.</span></span><br />\r\n&nbsp;</p>','NA','','','->Maximum team strength allowed is 25 dancers.\r\n->On stage maximum 14 members allowed at a time. Rest can rotate between rounds.\r\n->A maximum of 22 teams can participate in the event.\r\n->The final event will consist of 3 rounds.',0,'','TBA','TBA','TBA',0,0,0,0,'Parikshit Parate  7240466917/8007883949',3),(77,'Desert Duel','<p style=\"margin-left:0cm; margin-right:0cm\">It is a solo dance event in which dancers from every college participate and showcase their talent. Depending on the dancer, styles can vary from western to classical to hip-hop and even to the typical Bollywood style.</p>','NA','','','->A maximum of 6 entries per college.\r\n->Individual participation.\r\n->The event comprises of eliminations followed by finals.',0,'','TBA','TBA','TBA',0,0,0,0,'Rudraj Mehta  9983086838/ 9429169124',3),(78,'Choreo','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"color:#222222\">Choreo is a dance event which features contemporary dance performances by teams from colleges around the country. This event is conducted in the central auditorium. After the initial elimination round, about six to eight teams are shortlisted for the final round. The final round features contemporary dance performances that are usually based on a certain theme.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Jaanvi +91-8200127872',3),(79,'VLOG MAKING','<p>Vlog making competition is a competition in which contestants have to make a v-log of the 5 days of Oasis in a creative and artistic sense, also justifying the theme and submit the entries 2 days after the completion of the fest.</p>','NA','','','->Time Limit: 1-5 minutes (Including credits) \r\n->The video should be in Hindi or English or both. \r\n->Use of vulgar language or action of any sort will lead to immediate disqualification.\r\n->Sound tracks and stock footage can be borrowed, but with due credits.\r\n->Entries must be the original work of the entrant and must not infringe third-party\'s rights.\r\n->Please note that Oasis/Metamorphosis/Film Making Club will not be responsible for postal delays, losses or damages. Make sure you send in the entries sufficiently before the deadline',0,'','TBA','TBA','TBA',0,0,0,0,'Damanjot Singh, +918966911000   Jared Dominic Fernandez - +919061355311   Eashan - 9370141298',6),(80,'ASTROGRAPHY','<p style=\"margin-left:0cm; margin-right:0cm\">It&rsquo;s a photography competition where participants take pictures of the sky and other celestial objects using their mobile phones and come up with witty captions for their photos to go along with the Oasis theme. This shall be held on FD-3 Terrace as well, in parallel with The Night&rsquo;s Watch. The event will be for 4 hours.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Vigynesh Bhatt 9582967409',9),(81,'BITS Pilani Open Mic','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:#222222\">The BITS Pilani Open Mic is the perfect platform for budding standup comedians to get over their stage fears and showcase their knack for savagery and humor.</span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Devansh  7987023229',13),(82,'Improv Comedy Competition','<p>Exploring the most unconventional form of comedy, the Improv Comedy Challenge involves participants in exciting fast-paced improv games, hilarious stories, scenes, and songs right on the spot and in the moment.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Devansh  7987023229',13),(83,'Tambola Tales','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"color:#222222\">An event to satisfy all your cravings for composing pieces related to poetry, story, rap or songs of your own. One can enjoy here the game of housie along with the fun of debating and composing.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sashank - 6375352568 ,  Aman - 9472839032',8),(84,'TRIPPED: A VR Gaming Event','<p style=\"margin-left:0cm; margin-right:0cm\">Feeling yourself loosen up like a hippie? Or loud and energetic like a Punk? This Oasis experience the counterculture inside you and fight others in the grand cultural festival.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aman Kumar +91-9829915088',9),(85,'Comedy Talk Show','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',13);
